import './App.css';
import React , {useEffect, useState} from 'react'

function App() {

  const [backendData, setBackendData ] = useState([{}])

  useEffect(() => {
    fetch("/api").then(
      responsev => response.json()
    ).then(
      data => {
        setBackendData(data)
      }
    )
  }, [])

  return (
    <div className="App">

    </div>
  );
}

export default App;
